vehicles: they all need rare earth materials.\n\nAmong the first to recognize this were the Chinese. Today China mines an incredible 97% of all rare earth minerals extracted worldwide. The Chinese government makes good use of this monopoly: recently, it cut production by about two-thirds. Within days the prices of some rare earth metals shot up by 1000%. However, the Chinese also have to deal with the downside of rare earth mining: Environmental pollution, destroyed landscapes and radioactive residues, as rare earth metal deposits are usually laced with radioactive minerals and are extremely difficult to refine.\n\nBecause of the scarcity of rare earth deposits, the sky-rocketing prices on the international commodity market and the environmental problems associated with mining and processing, scientists around the world are looking for new, better ways to source these minerals. We follow researchers as they drill for new deposits in Europe and Australia, we see how they try and find new, more environmentally friendly ways of processing the materials, we discover how they try and recycle them out of old mobile phones and computers – and we reveal how physicists and chemists are working on ground-breaking new materials that could soon replace rare earths completely – a fascinating glimpse at cutting-edge research that could make our green technologies of the future even greener.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #rareearths \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries s, we discover how they try and recycle them out of old mobile phones and computers – and we reveal how physicists and chemists are working on ground-breaking new materials that could soon replace rare earths completely – a fascinating glimpse at cutting-edge research that could make our green technologies of the future even greener.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #rareearths \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering."},"lengthSeconds":"3111","ownerProfileUrl":"http://www.youtube.com/@FD_Engineering","externalChannelId":"UCKFjNynYRgDfnSIXzELPqTA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF"  completely – a fascinating glimpse at cutting-edge research that could make our green technologies of the future even greener.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #rareearths \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering.","commandRuns":[{"startIndex":127,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJwEEM2rARgBIhMIrLXuqqrugAMVsBXxBR2nbQv8","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=VcU0umWyfvk\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"VcU0umWyfvk","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-n545gpjvh-hc5e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026beids=24350017\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=55c534ba65b27ef9\u0026ip=105.160.120.134\u0026initcwndbps=236250\u0026mt=1692640396\u0026oweuc="}}}}}}},{"startIndex":1831,"length":28,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJwEEM2rARgBIhMIrLXuqqrugAMVsBXxBR2nbQv8SOna_aKryMvTNQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa3dxc0ViZ3N5RndyU1JQOEhNUERBQUYyVkUwZ3xBQ3Jtc0tuejU0cGhUN2d6N3VhOF9SR0tuR0NYaW9ubFBUYlk3TWJOVUlfMXQyb2ctaEQwN2syN1NKbEVaempEdUJCanEtY0ZNNnh3NDhaUkYtZ2wyVXpPZ1BhZi13XzNJM3BmX2g0LWtnRU ":"https://yt3.ggpht.com/gmUlT_9Myq4ZbzpLPDnZjT8K4FX1bbImM6KY0xbk8eGnGfh6u6AfkqiVAJC1N_2LnvYaYwv8=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Rare Earth Mining: The Key to our Technological Future | FD Engineering\n\nWatch 'Mega Machines: Taming Mechanical Giants' here:    • Mega Machines: Taming Mechanical Gian...  \n\nFor thousands of years, they lay dormant in the soil until suddenly, they became the driving force behind a technical revolution. Smart phones, laptops, touch screens, wind turbines, hybrid vehicles: they all need rare earth materials.\n\nAmong the first to recognize this were the Chinese. Today China mines an incredible 97% of all rare earth minerals extracted worldwide. The Chinese government makes good use of this monopoly: recently, it cut production by about two-thirds. Within days the prices of some rare earth metals shot up by 1000%. However, the Chinese also have to deal with the downside of rare earth mining: Environmental pollution, destroyed landscapes and radioactive residues, as rare earth metal deposits are usually laced with radioactive minerals and are extremely difficult to refine.\n\nBecause of the scarcity of rare earth deposits, the sky-rocketing prices on the international commodity market and the environmental problems associated with mining and processing, scientists around the world are looking for new, better ways to source these minerals. We follow researchers as they drill for new deposits in Europe and Australia, we see how they try and find new, more environmentally friendly ways of processing the materials, we discover how they try and recycle them out of old mobile phones and computers – and we reveal how physicists and chemists are working on ground-breaking new materials that could soon replace rare earths completely – a fascinating glimpse at cutting-edge research that could make our green technologies of the future even greener.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #rareearths \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering.","commandRuns":[{"startIndex":127,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCsQ040EGAYiEwiste6qqu6AAxWwFfEFHadtC_w=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=VcU0umWyfvk\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"VcU0umWyfvk","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-n545gpjvh-hc5e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026beids=24350017\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=55c534ba65b27ef9\u0026ip=105.160.120.134\u0026initcwndbps=236250\u0026mt=1692640396\u0026oweuc="}}}}}}},{"startIndex":1831,"length":28,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCsQ040EGAYiEwiste6qqu6AAxWwFfEFHadtC_xI6dr9oqvIy9M1","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbGpmQlJYbXRfcTJXWDE0aXMtcUNZUU82VWVTUXxBQ3Jtc0tsMXlMcjZncWpWU1hBeHlVdkZCNkhtWXc5bUV2NF9ubnpqc2dZUXRNZFVaa28ybHRWNlgtTE1FQXE4U2RhclZ6b3VoVDEyZ0laU0tWeV9HUzh2OU9JV3kxRDdOM3E2Z190eUpVbmlrZXhNZWlMYURmWQ\u0026q=https%3A%2F%2Fbit.ly%2FFDEngineering\
